import React from 'react';
import '../assets/styles/App.css';

const About = () => {
  return (
    <div className="content">
      <h1 style={{ color: '#e96f7c', textAlign: 'center' }}>
        - About -
        <br />
        In maintenance
      </h1>
    </div>
  );
};

export default About;
